import React, { Component } from 'react';


class ContactPhone extends Component {

    constructor(props){
        super(props);
        this.state={userData:{} }
    }

    static getDerivedStateFromProps(nextProps){
        return {userData: nextProps.match.params.name}
    }

    componentDidMount(){}

    componentDidUpdate(){return true;}

    back=()=>{
        console.log(this.props.history , 'rout history');
        this.props.history.push('/contact/:ID');
    };

    render() {

        return (
            <div className="">
{/*
                name:{this.state.userData.name}<br/>
*/}
                <input type='button' value='Back' onClick={this.back}/>
            </div>
        );
    }
}

export default ContactPhone;
